import React from 'react';
import logo from './images/logo.png'
import "./Header.css";

function Header() { 
    return (

        <div className = "main">

        
        <div className = "mainlogo">
            <img src = {logo} alt = "main">

            </img>
        </div>    

        <div className = "Mid">

            <h2> Welcome! Nosedive into the MODERN WORLD of the Tech! </h2> 
            

    
            

        </div>

        </div>
    )
}

export default Header;
